  `product_type` varchar(255) CHARACTER SET utf8 NOT NULL,
  `product_commision_type` varchar(255) CHARACTER SET utf8 NOT NULL,
  `product_commision_value` double NOT NULL,
  `product_status` int(11) NOT NULL,
