  `allow_comment` int(11) NOT NULL,
  `state_id` int(11) DEFAULT NULL,
  `product_avg_rating` int(11) NOT NULL DEFAULT 0,
  `product_variations` text CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`product_id`)
